INSERT INTO `practices` VALUES (1,'Estimar el alcance del proyecto','¿Se estima el alcance del proyecto?','Ejemplo: Establecer un WBS (Estructura de descomposición de trabajo) para estimar el alcance del proyecto.',0,1,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(2,'Establecer las estimaciones de los atributos de los productos de trabajo y de las tareas','¿Se establecen las estimaciones de los atributos de los productos de trabajo y de las tareas?','Ejemplos de atributos para estimar son:\n* Número y complejidad de los requisitos.\n* Número y complejidad de las interfaces.\n* Número de funciones.\n* Puntos función.\n* Líneas de código fuente.',0,1,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(3,'Definir las fases del ciclo de vida del proyecto','¿Se definen las fases del ciclo de vida del proyecto?','Ejemplo de productos de trabajo: Fases del ciclo de vida del proyecto.',0,1,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(4,'Estimar el esfuerzo y el coste','¿Se estima el esfuerzo y coste?','Ejemplos de productos de trabajo:\n* Análisis razonado de la estimación.\n* Estimaciones del esfuerzo del proyecto.\n* Estimaciones del coste del proyecto.',1,1,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(5,'Establecer el presupuesto y el calendario','¿Se establece el presupuesto y el calendario? ','Ejemplo de productos de trabajo: Fases del ciclo de vida del proyecto.',0,2,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(6,'Identificar los riesgos del proyecto','¿Se identifican los riesgos del proyecto? ','Ejemplo de productos de trabajo:\n* Riesgos identificados\n* Impactos y probabilidad de ocurrencia de los riesgos\n* Prioridades de los riesgo ',0,2,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(7,'Planificar la gestión de los datos','¿Se planifica la gestión de los datos del proyecto?','Ejemplo de productos de trabajo:\n* Plan para la gestión de datos\n* Lista maestra de datos gestionados\n* Calendario para la recogida de datos del proyecto\n* Listado de datos del proyecto a recoger',0,2,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(8,'Planificar los recursos del proyecto','¿Se planifican los recursos del proyecto?','Ejemplo de productos de trabajo:\n* Paquetes de trabajo.\n* Diccionario de tareas de la WBS.\n* Requisitos de personal basados en el tamaño y el alcance del proyecto.\n* Lista de instalaciones y equipamientos críticos.\n* Lista de requisitos de administración del proyecto. ',0,2,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(9,'Planificar el conocimiento y las habilidades necesarias','Se planifica el conocimiento y las habilidades necesarias? ','Ejemplo de productos de trabajo:\n* Inventario de habilidades necesarias.\n* Planes de personal y nuevas contrataciones.\n* Bases de datos (p. ej., habilidades, formación).\n* Planes de formación.',0,2,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(10,'Planificar la involucración de las partes interesadas','¿Se planifica la involucración de las partes interesadas? ','Ejemplo de productos de trabajo: Plan para la involucración de las partes interesadas',0,2,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(11,'Establecer el plan de proyecto','¿Se establece el plan del proyecto? ','Ejemplo de productos de trabajo: Plan global del proyecto',1,2,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(12,'Revisar los planes que afectan al proyecto','¿Se revisan los planes que afectan al proyecto?','Ejemplo de productos de trabajo: Registro de la revisiones de los planes que afectan al proyecto.',0,3,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(13,'Conciliar los niveles de trabajo y de recursos','¿Se concilian los niveles de trabajo y de recursos?','Ejemplo de productos de trabajo:\n* Métodos y parámetros de estimación correspondientes modificados (p. ej., mejores herramientas, uso de productos comerciales).\n* Presupuestos renegociados.\n* Calendarios modificados.\n* Lista de requisitos modificada.',0,3,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(14,'Obtener el compromiso con el plan','¿Se obtiene un compromiso con el plan?','Ejemplo de productos de trabajo:\n* Peticiones de compromisos documentadas.\n* Compromisos documentados. ',1,3,'2016-06-01 17:51:22','2016-06-01 17:51:22');
