INSERT INTO `scrum_practices` VALUES (1,'No soportada','En Scrum el WBS se compone de Product Backlog y de los Sprints predefinidos, sin embargo, el Producto Backlog es elaborado por el cliente y presentado por el Product Owner, sin presentar guías sobre cómo se éste se crea.',NULL,NULL,NULL,NULL,NULL,NULL,0,1,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(2,'Estimar atributos mediante Planning Poker o Magic Estimation','Scrum establece una primera estimación en la fase pre-game y una estimación iterativa al principio del sprint (reunión de planificación). Las estimaciones se basan generalmente en tamaño o complejidad atributos','Estimation meeting','* El Product Backlog, el cual es priorizado por el Product Owner de acuerdo con el valor del negocio.\n* Tarjetas numeradas Planing  Poker o Magic Estimation.','1. El Product Owner presenta los ítems del Product Backlog que necesitan se estimados por el Equipo.\n2. El equipo utiliza Planning Poker or Magic Estimation para estimar los items del Backlog.\n3. En caso de que un ítem sea muy largo, el equipo lo dividirá en ítems más pequeños.\n4. Vuelva a calcular todos los ítems del Backlog que puedan ser jalados durante los siguientes tres Sprints.\n5. Identifica los ítems del Backlog que necesitan ser aclarados por el Product Owner hasta la siguiente reunión de estimación.',NULL,'Planning Poker, Magic Estimation','Fijar el tiempo a 35 minutos o menos',2,2,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(3,'Utilizar el ciclo de vida de Scrum ','El ciclo de vida de Scrum se compone de 4 fases (Larman, 2004):\nPlanning: Establece una visión del proyecto y las expectativas de los interesados, más allá de asegurar la financiación / presupuesto para la ejecución del proyecto.\nStaging: Identifica y prioriza los requisitos (al menos, para el siguiente sprint). Divide el Product Backlog en Sprints de acuerdo con la priorización anterior, teniendo en cuenta la productividad del equipo.\nDevelopment: Implementa el sistema en un conjunto de iteraciones de 30 días (Sprints), cuando, al final de cada sprint, un incremento del producto se presenta a las partes interesadas.\nRelease: Despliegue del sistema.',NULL,NULL,NULL,NULL,NULL,NULL,2,3,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(4,'Estimar el esfuerzo de las historias de usuario','Los practicantes de Scrum estiman el esfuerzo de las historias de usuario en días basándose en sprints previos, proyectos anteriores y la complejidad relativa de las historias de usuario.\nEl costo no se menciona explícitamente en SCRUM, por lo cual esta práctica es parcialmente soportada.','Sprint Planning Meeting #1','* El Product Backlog estimado y pririzado.\n* Rotafolios, marcadores, tijeras, notas adhesivas, pizarras, lápices, etc.','1. Comenzar con el primer ítem del Product Backlog (Historia).\n2. El equipo discute y analiza los requerimientos de la historia.\n3. El equipo elabora las pruebas de aceptación de usuario.\n4. Anotar las restricciones.\n5. Definir los criterios de aceptación.\n6. Determinar el nivel de Hecho para la historia.\n7. Dibujar bocetos de las funcionalidades de la historia.\n8. Para el siguiente ítem del Backlog, regresar al paso 1.','- Burn down chart\n- Burn up chart',NULL,'60 minutos por semana de Sprint.',1,4,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(5,'Establecer Sprints','Durante la fase pre-game  se establecen hitos (objetivos del sprint) y calendarios (sprints) de acuerdo al Backlog inicial.\nPor otra parte, Scrum no provee orientaciones sobre el establecimiento de presupuesto, por lo cual esta práctica es parcialmente soportada.','Sprint Planning Meeting #2','* El Product Backlog seleccionado para el Sprint.\n* Rotafolios, marcadores, tijeras, notas adhesivas, pizarras, lápices, etc.','1. Comenzar con el primer ítem del Product Backlog.\n2. Recapitular la comprensión del equipo de lo que es realmente deseado examinado los rotafolios de reunión de planificación de Sprint # 1.\n3. Ejecutar una discusión orientada a como podría ser implementado el ítem del Backlog.\n  Estas preguntas pueden ayudar:\n  a) ¿Qué interfaces necesitamos escribir?\n  b) ¿Qué bases de datos necesitaremos?\n  c) ¿Qué arquitectura es necesaria?\nUna vez que el equipo tiene un claro entendimiento de la manera en la que desea construir una característica, se puede pasar al siguiente ítem del Backlog.',NULL,NULL,'60 minutos por semana de Sprint',1,5,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(6,'Identificar lista de impedimentos','SCRUM considera un riesgo como un posible impedimento para el proyecto. La identificación de los riesgos se produce de forma iterativa, durante las reuniones diarias registrando en pizarras, rotafolios o la lista de impedimentos.\nSin embargo, la identificación de riesgos no se produce de una manera sistemática utilizando las categorías de riesgo y  sus fuentes. Por lo tanto, esta práctica es parcialmente soportada.','Daily Scrum','* Taskboard (Tabla de tareas)\n* Notas adhesivas\n* Marcadores ','1. El equipo se reúne alrededor del Taskboard.\n2. Uno de los miembros del equipo comienza explicando a sus compañeros lo que ha logrado poner en práctica desde el última Scrum Diario.\n3. El miembro del equipo mueve la tarea correspondiente en la columna correcta de la TaskBoard.\n4. En su caso, el miembro del Equipo recoge una nueva tarea y la coloca en la columna \"Work in Progress\".\n5. Si el miembro del equipo ha detectado un problema o impedimento desde el último Scrum Diario, lo reporta al ScrumMaster quien toma nota para la eliminación inmediata.',NULL,NULL,'15 minutos, a la misma hora y ubicación todos los días',1,6,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(7,'No soportada','En Scrum cualquier dato generado en el proyecto se almacenan en carpetas públicas o pizarras al alcance de todos, pero no hay un plan de gestión de datos formal o procedimiento para recoger estos datos.',NULL,NULL,NULL,NULL,NULL,NULL,0,7,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(8,'Establecer el Equipo Scrum','Durante  la fase pre-game, los requerimientos de personal y la lista de equipamiento se definen. Como resultado se establece el Equipo Scrum. Durante la ejecución sprints, el ScrumMaster es el encargado de proporcionar nuevos recursos que sean necesarios.','Sprint Planning Meeting #2','* El Product Backlog seleccionado para el Sprint.\n* Rotafolios, marcadores, tijeras, notas adhesivas, pizarras, lápices, etc.','1. Comenzar con el primer ítem del Product Backlog.\n2. Recapitular la comprensión del equipo de lo que es realmente deseado examinado los rotafolios de reunión de planificación de Sprint # 1.\n3. Ejecutar una discusión orientada a como podría ser implementado el ítem del Backlog.\n  Estas preguntas pueden ayudar:\n  a) ¿Qué interfaces necesitamos escribir?\n  b) ¿Qué bases de datos necesitaremos?\n  c) ¿Qué arquitectura es necesaria?\nUna vez que el equipo tiene un claro entendimiento de la manera en la que desea construir una característica, se puede pasar al siguiente ítem del Backlog.',NULL,NULL,'60 minutos por semana de Sprint',2,8,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(9,'No soportada','En Scrum los equipos son multifuncionales y auto-gestionados, el conocimiento y las habilidades necesarias se identifican durante la fase pre-game. Sin  embargo, Scrum no menciona la necesidad de planificar el conocimiento y habilidades necesarias para realizar las actividades del proyecto.',NULL,NULL,NULL,NULL,NULL,NULL,0,9,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(10,'Definir roles y responsabilidades al principio y fin del Sprint','Scrum define roles, responsabilidades y participación de las partes interesadas al principio y al final de cada sprint. Esta participación es supervisada por el Scrum Master y registrada en un plan de comunicación.',NULL,NULL,NULL,NULL,NULL,NULL,1,10,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(11,'Establecer el plan del proyecto con base en el Product Backlog','El documento de visión y el Producto Backlog crean una base para la elaboración de un plan de proyecto de alto nivel.\nLa visión describe por qué el proyecto se está realizando y lo cual es el estado final deseado. El Product Backlog define los requisitos funcionales y no funcionales que el sistema debe cumplir para entregar la visión, priorizados y estimados.','TaskBoard',NULL,'Crear un tablero con las siguientes columnas:\n1. Selected Product Backlog (Historias). Esta columna contiene todos los ítems del Backlog que el equipo desea implementar en el Sprint actual, en orden priorizado.\n2. Task To Do. Son el resultado del Sprint Planning Meeting #2 o se han agregado durante el Sprint.\n3. Work in Progress. Cuando un miembro del equipo inicia una tarea, se mueve la nota adhesiva de esta tarea a esta columna.\n4. Done. Cuando se ha completado una tarea, se mueve la nota adhesiva a esta columna.','- Taskboard: Ofrece una descripción visual de los ítems seleccionados del Product Backlog (historias) y el Sprint Backlog (tareas).\na) El taskboard sólo es mantenido por el equipo.\nb) Nada vence la experiencia de usar un tablero físico en la pared o sala del equipo.\nc) Si hay equipos de software distribuidos, un software para el taskboard le ayudará a mantener la comunicación entre distancias.',NULL,NULL,2,11,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(12,'Revisar los planes que afectan al proyecto en la revisión de Sprint','En Scrum, los planes se revisan al comienzo de cada sprint y las posibles adaptaciones se llevan a cabo conforme al cambio de requisitos y tecnologías.','Sprint Review','* Incremento del producto potencialmente entregable, presentado por el equipo.\n* Taskboard, notas adhesivas, marcadores.','1. El Product Owner da la bienvenida a los participantes del Sprint Review\n2. El Product Owner les recuerda a los presentes el propósito del Sprint pasado: el objetivo del Sprint, el cual soporta las historias que el equipo había seleccionado.\n3. Los miembros del equipo de desarrollo demuestran las nuevas funcionalidades y piden al usuario final que las prueben.\n4. El Scrum Master modera la sesión.\n5. La retroalimentación del usuario final es documentada por el ScrumMaster.',NULL,NULL,'90 min. al final del Sprint',2,12,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(13,'Conciliar los niveles de trabajo y de recursos en la planificación de Sprints','Durante la reunión de planificación de Sprint se produce la conciliación de trabajo debido a que el Backlog es dinámico, por lo que son posibles nuevas estimaciones y calendarios.\nEl equipo, el Product Owner y el Scrum Master definen las funcionalidades que se desarrollarán en el Sprint.','Sprint Planning Meeting #2','* El Product Backlog seleccionado para el Sprint.\n* Rotafolios, marcadores, tijeras, notas adhesivas, pizarras, lápices, etc.','1. Comenzar con el primer ítem del Product Backlog.\n2. Recapitular la comprensión del equipo de lo que es realmente deseado examinado los rotafolios de reunión de planificación de Sprint # 1.\n3. Ejecutar una discusión orientada a como podría ser implementado el ítem del Backlog.\n  Estas preguntas pueden ayudar:\n  a) ¿Qué interfaces necesitamos escribir?\n  b) ¿Qué bases de datos necesitaremos?\n  c) ¿Qué arquitectura es necesaria?\nUna vez que el equipo tiene un claro entendimiento de la manera en la que desea construir una característica, se puede pasar al siguiente ítem del Backlog.',NULL,NULL,'60 minutos por semana de Sprint',2,13,'2016-06-01 17:51:22','2016-06-01 17:51:22'),(14,'Obtener el compromiso con el plan durante la planificación de Sprints ','El compromiso del plan se produce de forma continua al comienzo de cada sprint, durante la reunión de planificación de Sprint. En ella el ScrumMaster pregunta al equipo si desea comprometerse con cada ítem del Product Backlog.','Sprint Planning Meeting #1','* El Product Backlog estimado y pririzado.\n* Rotafolios, marcadores, tijeras, notas adhesivas, pizarras, lápices, etc.','1. Comenzar con el primer ítem del Product Backlog (Historia).\n2. El equipo discute y analiza los requerimientos de la historia.\n3. El equipo elabora las pruebas de aceptación de usuario.\n4. Anotar las restricciones.\n5. Definir los criterios de aceptación.\n6. Determinar el nivel de Hecho para la historia.\n7. Dibujar bocetos de las funcionalidades de la historia.\n8. Para el siguiente ítem del Backlog, regresar al paso 1.\nUna vez elegidos los ítems que se van a desarrollar en el Sprint, el ScrumMaster le pregunta al equipo si se compromete a entregar dichos ítems.',NULL,NULL,'60 minutos por semana de Sprint.',2,14,'2016-06-01 17:51:22','2016-06-01 17:51:22');
